import { Link } from "react-router-dom";

const NFTList = ({ nfts, nftTitle}) => {

    return (
        <div className="nft-list">
            <h2>{ nftTitle }</h2>
            {nfts.map((nft) => (
                <div className="vibe-preview" key={nft.id}>
                    <Link to={`/nfts/${nft.id}`}>
                        <h2>{ nft.nftTitle }</h2>
                        <p>boom</p>
                    </Link>
                </div>
            ))}
        </div>
    );
}

export default NFTList;
